def scoreDeltaGenerator(Bidrequest) -> float:
    try:
        advertiser = str(Bidrequest.getAdvertiserId())
        creativeID = str(Bidrequest.getCreativeID())
        adExchange = str(Bidrequest.getAdExchange())
        region = str(Bidrequest.getRegion())
        adSlotFormat = str(Bidrequest.getAdSlotFormat())
        adSlotVisibility  = str(Bidrequest.getAdSlotVisibility())
    except AttributeError as e:
        print(f"Error: Bidrequest missing required attribute: {e}")
        return -1.0

    if(advertiser == "1458"):
        return advertiserId1458(creativeID, adExchange, region, adSlotFormat, adSlotVisibility)
    elif(advertiser== "3358"):
        return advertiserId3358(creativeID, adExchange, region, adSlotFormat, adSlotVisibility)
    elif(advertiser== "3386"):
        return advertiserId3386(creativeID, adExchange, region, adSlotFormat, adSlotVisibility)
    elif(advertiser== "3427"):
        return advertiserId3427(creativeID, adExchange, region, adSlotFormat, adSlotVisibility)
    elif(advertiser== "3476"):
        return advertiserId3476(creativeID, adExchange, region, adSlotFormat, adSlotVisibility)
    else:
        print(f"Error: Advertiser ID '{advertiser}' not recognized.")
        return -1.0
